PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT 
    ?g (SAMPLE(?gLabel) AS ?gLabel) 
    (COUNT(?g) as ?count) 
    ((?tu / 12) as ?t)

WHERE {

      VALUES ?p { <http://www.wikidata.org/prop/direct/P21> } 
      ?s ?p ?o



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q55> }
        ?s ?p0 ?o0



        BIND (?o as ?g)
        OPTIONAL { ?g rdfs:label ?gLabel filter (lang(?gLabel) = "en"). }



      VALUES ?tp { <http://www.wikidata.org/prop/direct/P570> }
      ?s ?tp ?tv
      FILTER(YEAR(xsd:dateTime(?tv)) > -99999)



      { SELECT (COALESCE(MIN((YEAR(xsd:dateTime(?tv)) * 12 + MONTH(xsd:dateTime(?tv)))), 0) AS ?t_min)  (COALESCE(MAX((YEAR(xsd:dateTime(?tv)) * 12 + MONTH(xsd:dateTime(?tv)))), 0) AS ?t_max)

WHERE {

      VALUES ?p { <http://www.wikidata.org/prop/direct/P21> } 
      ?s ?p ?o



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q55> }
        ?s ?p0 ?o0



      VALUES ?tp { <http://www.wikidata.org/prop/direct/P570> }
      ?s ?tp ?tv
      FILTER(YEAR(xsd:dateTime(?tv)) > -99999)

}



 }
      BIND (((?t_max - ?t_min) / 87) AS ?t_step)

}
GROUP BY
    (?g)
    ((0.5 + xsd:integer(((YEAR(xsd:dateTime(?tv)) * 12 + MONTH(xsd:dateTime(?tv))) - ?t_min) / ?t_step)) * ?t_step + ?t_min as ?tu)
HAVING ( COUNT(?g) >= 1 )
ORDER BY desc(?count)
LIMIT 87

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT 
    (SAMPLE(?s) AS ?s) (SAMPLE(?sLabel) AS ?sLabel) 
    (SAMPLE(?p) AS ?p) (SAMPLE(?pLabel) AS ?pLabel) 
    ?o (SAMPLE(?oLabel) AS ?oLabel) 
    ?tv

WHERE {

      VALUES ?p { <http://www.wikidata.org/prop/direct/P21> } 
      ?s ?p ?o



    OPTIONAL { ?s rdfs:label ?sLabel filter (lang(?sLabel) = "en"). }
    OPTIONAL { ?p rdfs:label ?pLabel filter (lang(?pLabel) = "en"). }
    OPTIONAL { ?o rdfs:label ?oLabel filter (lang(?oLabel) = "en"). }



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q55> }
        ?s ?p0 ?o0



      VALUES ?tp { <http://www.wikidata.org/prop/direct/P570> }
      ?s ?tp ?tv
      FILTER(YEAR(xsd:dateTime(?tv)) > -99999)

}
GROUP BY
    (?o)
    (?tv)


LIMIT 100

SELECT *

WHERE {

    { SELECT (COUNT(?s) AS ?complete_count)

WHERE {

      VALUES ?p { <http://www.wikidata.org/prop/direct/P21> } 
      ?s ?p ?o



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q55> }
        ?s ?p0 ?o0

}



 }
    { SELECT (COUNT(?s) AS ?total_count)

WHERE {
?s ?p ?o


        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q55> }
        ?s ?p0 ?o0

}



 }

}



LIMIT 20

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT 
    ?g (SAMPLE(?gLabel) AS ?gLabel) 
    (COUNT(?g) as ?count) 


WHERE {

      VALUES ?p { <http://www.wikidata.org/prop/direct/P27> } 
      ?s ?p ?o



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q572062>
<http://www.wikidata.org/entity/Q169470> }
        ?s ?p0 ?o0



        BIND (?o as ?g)
        OPTIONAL { ?g rdfs:label ?gLabel filter (lang(?gLabel) = "en"). }

}
GROUP BY
    (?g)
HAVING ( COUNT(?g) >= 2 )
ORDER BY desc(?count)
LIMIT 26

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT 
    (SAMPLE(?s) AS ?s) (SAMPLE(?sLabel) AS ?sLabel) 
    (SAMPLE(?p) AS ?p) (SAMPLE(?pLabel) AS ?pLabel) 
    ?o (SAMPLE(?oLabel) AS ?oLabel) 


WHERE {

      VALUES ?p { <http://www.wikidata.org/prop/direct/P27> } 
      ?s ?p ?o



    OPTIONAL { ?s rdfs:label ?sLabel filter (lang(?sLabel) = "en"). }
    OPTIONAL { ?p rdfs:label ?pLabel filter (lang(?pLabel) = "en"). }
    OPTIONAL { ?o rdfs:label ?oLabel filter (lang(?oLabel) = "en"). }



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q572062>
<http://www.wikidata.org/entity/Q169470> }
        ?s ?p0 ?o0

}
GROUP BY
    (?o)


LIMIT 100

SELECT *

WHERE {

    { SELECT (COUNT(?s) AS ?complete_count)

WHERE {

      VALUES ?p { <http://www.wikidata.org/prop/direct/P27> } 
      ?s ?p ?o



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q572062>
<http://www.wikidata.org/entity/Q169470> }
        ?s ?p0 ?o0

}



 }
    { SELECT (COUNT(?s) AS ?total_count)

WHERE {
?s ?p ?o


        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q572062>
<http://www.wikidata.org/entity/Q169470> }
        ?s ?p0 ?o0

}



 }

}



LIMIT 26

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?p ?pLabel ?o ?oLabel

WHERE {

    VALUES ?s { <http://www.wikidata.org/entity/Q937> }
    ?s ?p ?o .
    FILTER(!isLiteral(?o) || langMatches(lang(?o), "en"))
    OPTIONAL { ?p rdfs:label ?pLabel filter (lang(?pLabel) = "en"). }
    OPTIONAL { ?o rdfs:label ?oLabel filter (lang(?oLabel) = "en"). }

}



LIMIT 201

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?o
?oLabel
?p0
?p0Label
?s0
?s0Label
?p1
?p1Label
?s1
?s1Label

WHERE {

        VALUES ?o { <http://www.wikidata.org/entity/Q937> }
        OPTIONAL { ?o rdfs:label ?oLabel filter (lang(?oLabel) = "en"). }


VALUES ?p0 { <http://www.wikidata.org/prop/direct/P1038> }

?s0 ?p0 ?o

FILTER(!isLiteral(?s0) || langMatches(lang(?s0), "en"))


        OPTIONAL { ?s0 rdfs:label ?s0Label filter (lang(?s0Label) = "en"). }
        OPTIONAL { ?p0 rdfs:label ?p0Label filter (lang(?p0Label) = "en"). }


VALUES ?p1 { <http://www.wikidata.org/prop/direct/P1038> }

OPTIONAL { ?s1 ?p1 ?s0 }

FILTER(!isLiteral(?s1) || langMatches(lang(?s1), "en"))


        OPTIONAL { ?s1 rdfs:label ?s1Label filter (lang(?s1Label) = "en"). }
        OPTIONAL { ?p1 rdfs:label ?p1Label filter (lang(?p1Label) = "en"). }

}



LIMIT 26

